  \"2015-02-04T19:07:39.577202\",\n\t\"name\": \"graduation-outcomes-class-of-2010-regents-based-math-ela-apm-school-level-ea88b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Graduation Outcomes - Class of 2010 - Math/ELA
  Aspirational Performance Measure (APM) rnu00b6u2022The New York State Education
  Department adopted Aspirational Performance Measures (APM) in addition to high school
  graduation rates for the Cohort of 2006 (Class of 2010). In addition to the numbers
  of students earning Advanced Regents Designation on their diplomas, another metric
  was developed based on performance on Math and ELA Regents exams. The Math/ELA APM
  represents the percentage of students in the cohort who graduated with any regular
  diploma (Regents Diploma with Advanced Designation, Regents Diploma, or Local Diploma)
  and who scored 80 or greater on their highest mathematics Regents and 75 or greater
  on the English Regents. Since this metric is new for the Class of 2010, only one
  year of results is reported, separately for June and August graduation cohorts.
  The total number of students in the cohort is the same in June and August. rnu00b6u2022Records
  with cohorts of 20 students or less are suppressed. rnu00b6u2022August outcomes
  include all June and August graduates. rnu00b6u2022In school-level reporting, students
  who were in a school for less than 5 months are not included in the schoolu2019s
  cohort, but are included in citywide totals. rnu00b6u2022School level results are
  not presented for District 79 schools, but their outcomes are included in citywide
  totals. rnu00b6u2022Schools that had previously obtained a waiver to use alternative
  assessments (rather than Regents examinations) were omitted from the Math/ELA APM
  calculations.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
